import React from "react";

const Card = (data) => {
    if (data[0]) {
        return (

            <div>
                <div>Place Name: {data[0].place_name}</div>
                <div>Reviewer: {data[0].reviewer}</div>
            </div>

        );
    } else {
        return (
            <div />
        );
    }
};

export default Card;
